const params = new window.URLSearchParams(window.location.search);

const authToken1 = 'JWT eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9..auTQVPyaDJ6XLm33UenC3hAghwqKIV9UXzBVFiOTgUA'
const authToken2 = 'JWT eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9..tCzycV76PJ_01j-Gu15U-wpdEOL1ugQFWe4hX6-6Xfw'
const userId = params.get('userId')


const socket = new WebSocket('ws://localhost:1337');
socket.addEventListener('open', (event) => {
  console.log('Websocket has been opened!')
})

socket.addEventListener('message', (event) => {
  console.log('Message from server:', event.data);
  const message = JSON.parse(event.data);
  switch (message.type) {
    case 'authHandShakeRequest':
      socket.send(JSON.stringify({
        type: 'authHandShakeResponse',
        data: userId == 1 ? authToken1 : authToken2
      }));
    break;
    case 'Message':
      const resultArea = document.getElementById('result');
      resultArea.innerHTML = JSON.stringify(message.data);
  }

})

document.getElementById('btnPing').addEventListener('click', (event) => {
  const sampleData = JSON.stringify({
    type: 'Ping',
    data: {
      message: 'Alo 123 456 789'
    }
  })
  socket.send(sampleData);
})

document.getElementById('btnSync').addEventListener('click', () => {
  const body = JSON.stringify({
    type: 'Data',
    data: {
      name: 'dmp_v1:facebook:syncData'
    }
  });
  fetch('http://localhost:3030/api/events', {
    method: 'post',
    headers: {
      authorization: authToken
    },
    body
  })
})
